import React from 'react';

const CalculateTotals = (props) => {

    return (
        <div>
            <p>Tax entered: {Math.floor((props.tax - 1) / 0.01)}%</p>
            <p>Tip entered: {Math.floor((props.tip - 1) / 0.01)}%</p>
        </div>
    )
}

export default CalculateTotals;
